import React, { Component } from 'react'
import { style_mapping } from "../../styled";

const {
    layout: { ContentArea },
    profile: { ProfileHeaderContainer, ProfilePicture, ProfileResume, ProfileName, ProfileCommands }
} = style_mapping;

class ProfileHeader extends Component {
  render() {
    return (
      <ContentArea>
        <ProfileHeaderContainer>
          <ProfilePicture />
          <ProfileResume>
            <ProfileHeaderTop>
            </ProfileHeaderTop>
            <ProfileHeaderBottom>
              <ProfileName />
              <ProfileCommands />
            </ProfileHeaderBottom>
          </ProfileResume>
        </ProfileHeaderContainer>
      </ContentArea>
    )
  }
}

export default ProfileHeader
